import React from "react";
import "./Nav.css";
import { Link } from "react-router-dom";

export default function Nav({ page, setPage }) {
  //this doesn't work... if you navigate without clicking...
  //istead maybe use params? to have teh variable for the page? or just state?
  const page2Title = page === "/add" ? "Tag Data" : "Add Data";
  const page2Link = page === "/add" ? "/tag" : "/add";

  return (
    <nav>
      <ul>
        <li>
          <Link to="/" onClick={() => setPage("/")}>
            Homepage
          </Link>
        </li>
        <li>
          <Link to={page2Link} onClick={() => setPage(page2Link)}>
            {page2Title}
          </Link>
        </li>
      </ul>
    </nav>
  );
}
